	public HashMap<String, String> sendOtpEKycRequest(String partnerId, String mispLicKey, String partnerKey, String strReq, String signature) throws IOException, ParseException {

		String resp = RestClient.sendOtpKYCRequest(token,strReq,signature, mispLicKey,partnerId, partnerKey);
		JSONParser parser = new JSONParser();
		JSONObject jsonObj = (JSONObject) parser.parse(resp);
		
		JSONObject respObj = (JSONObject) jsonObj.get("response");
		save2File(respObj.toJSONString(),"kycresponse.txt",false);

		HashMap<String,String> retVal = new HashMap<String,String>();
		retVal.put("authToken", respObj.get("authToken").toString());

		//Check new version or older logic
		if(respObj.containsKey("sessionKey")) {
		
			retVal.put("sessionKey", respObj.get("sessionKey").toString());
			retVal.put("identity", respObj.get("identity").toString());
					
		}
		else {
			String[] ret =splitResponse(respObj.get("identity").toString());
			retVal.put("sessionKey", ret[0]);
			
			retVal.put("identity", ret[1]);
			
		}
		
		return retVal;

	}
	String[] splitResponse(String encodedResponse) {
		String [] retVal  = new String[2];
		
		String keysplitter = "#KEY_SPLITTER#";
		
		byte[] byteResponse = CryptoUtil.decodeBase64(encodedResponse);
		int pos = indexOf(byteResponse,0,keysplitter.getBytes(), 0,0);
		System.out.println(pos);
		byte[] encKey = Arrays.copyOf(byteResponse,pos);
		int remLen = byteResponse.length ;
		byte[] encIdentity = Arrays.copyOfRange( byteResponse, pos + keysplitter.length(),remLen);

		retVal[0] = CryptoUtil.encodeBase64String(encKey);
		retVal[1] = CryptoUtil.encodeBase64String(encIdentity);
		
		
		return retVal;
	}
	static int indexOf(byte[] source, int sourceOffset, byte[] target, int targetOffset, int fromIndex) {
		  int sourceCount = source.length;
		  int targetCount = target.length;
		  
			if (fromIndex >= sourceCount) {
		        return (targetCount == 0 ? sourceCount : -1);
		    }
		    if (fromIndex < 0) {
		        fromIndex = 0;
		    }
		    if (targetCount == 0) {
		        return fromIndex;
		    }

		    byte first = target[targetOffset];
		    int max = sourceOffset + (sourceCount - targetCount);

		    for (int i = sourceOffset + fromIndex; i <= max; i++) {
		        /* Look for first character. */
		        if (source[i] != first) {
		            while (++i <= max && source[i] != first)
		                ;
		        }

		        /* Found first character, now look at the rest of v2 */
		        if (i <= max) {
		            int j = i + 1;
		            int end = j + targetCount - 1;
		            for (int k = targetOffset + 1; j < end && source[j] == target[k]; j++, k++)
		                ;

		            if (j == end) {
		                /* Found whole string. */
		                return i - sourceOffset;
		            }
		        }
		    }
		    return -1;
		}

	public HashMap<String, String> createOTPekycRequest(String uin,String partnerId, String otp) throws Exception {
			
		signHelper h = new signHelper(keyDir);
		
		HashMap<String, Object >payload = new HashMap<String,Object>();
		payload.put("otp", otp);
		payload.put("transactionId",trId);
		payload.put("timestamp",RestClient.getUTCDateTime( null));

		EncryptionRequestDto encryptionRequestDto = new EncryptionRequestDto();
		
		encryptionRequestDto.setIdentityRequest(payload);
		
		EncryptionResponseDto encryptionResponse = h.kernelEncrypt(encryptionRequestDto, "ida");

		JSONObject jsonReqAuth = new JSONObject();
		jsonReqAuth.put("bio", false);
		jsonReqAuth.put("demo", false);
		jsonReqAuth.put("pin", false);
		jsonReqAuth.put("otp", true);
		
		HashMap<String, Object > reqValues = new HashMap<String,Object>();
		reqValues.put("requestHMAC", encryptionResponse.getRequestHMAC());
		reqValues.put("requestSessionKey", encryptionResponse.getEncryptedSessionKey());
		reqValues.put("request", encryptionResponse.getEncryptedIdentity());
		reqValues.put("requestTime", RestClient.getUTCDateTime(null));
		reqValues.put("requestedAuth",jsonReqAuth);
				//"{\"bio\":false,\"demo\":false,\"otp\":true,\"pin\":false}");
		reqValues.put("transactionID", trId);
		reqValues.put("version", "1.0");
		reqValues.put("domainUri", Config.BASE_URL);
		reqValues.put("env", Config.BASE_URL);
		reqValues.put("specVersion", "1.0");
		reqValues.put("consentObtained", "true");
		reqValues.put("id", "mosip.identity.kyc");
		reqValues.put("individualId",uin);
		reqValues.put("individualIdType",Config.ID_TYPE);
	//	reqValues.put("keyIndex","string");
		//reqValues.put("secondaryLangCode","ara");

		X509Certificate cert =  h.getCertificateEntry(keyDir, "ida");
		byte[] encCert = DigestUtils.sha256(cert.getEncoded());

		reqValues.put("thumbprint",CryptoUtil.encodeBase64(encCert));

		
		String jsonStr = new ObjectMapper().writeValueAsString(reqValues);

		String signature = h.generateSignatureWithRequest(jsonStr, partnerId);
		
			//signature = response.headers.get("signature")
			//	        return { "response": response.text, "signature": signature}
			//	    return(response.text)
		HashMap<String, String> retValues = new HashMap<String,String>();
		retValues.put("reqStr", jsonStr);
		retValues.put("signature", signature);
		retValues.put("sessionKey", encryptionResponse.getEncryptedSessionKey());

		return retValues;
	}
	
	
	public  X509Certificate getCertificate( String fileName) throws IOException, CertificateException {
		Path path = Paths.get(keyDir + "/" + fileName);
		String certificateData = Files.readString(path);
		return (X509Certificate) CryptoHelper.convertToCertificate(certificateData);
	}
	public static String trimBeginEnd(String pKey) {
		pKey = pKey.replaceAll("-*BEGIN([^-]*)-*(\r?\n)?", "");
		pKey = pKey.replaceAll("-*END([^-]*)-*(\r?\n)?", "");
		pKey = pKey.replaceAll("\\s", "");
		return pKey;
	}
	public static JSONObject String2JSON(String strJson) throws ParseException {
		JSONParser parser = new JSONParser();
		JSONObject jsonObj = (JSONObject) parser.parse(strJson);
		return jsonObj;
	}
	public static void save2File(String data, String fileName, Boolean bEncoded) throws IOException {
		byte[] bData = null;
		if(bEncoded)
			bData = CryptoUtil.decodeBase64(data);
		else
			bData = data.getBytes();
		 Files.write(Path.of(fileName), bData);
	}
